function goToHome(){window.location.href="/"}async function getTeamRanks(){document.getElementById("viewScoutsButton").innerHTML="Requesting Data...";let e=new XMLHttpRequest;e.open("GET","/api/scouts",!0),e.withCredentials=!0,e.onreadystatechange=async()=>{if(e.readyState===XMLHttpRequest.DONE&&200===e.status){document.getElementById("viewScoutsButton").innerHTML="Rendering View...";let t=JSON.parse(e.responseText);for(var n="",s=0;s<t.length;s++)n+=`<tr><td><a href="/browse?discordID=${t[s].discordID}" style="all: unset; color: #2997FF; text-decoration: none;">${t[s].username}</a></td><td>${Math.round(t[s].score)}</td></tr>`;document.getElementById("preInsert").insertAdjacentHTML("afterend",n),document.getElementById("search").style.display="none",document.getElementById("results").style.display="flex",document.getElementById("eventCodeDisplay").innerHTML="Top scouts",document.getElementById("viewScoutsButton").innerHTML="Reload Data"}else 204===e.status&&3265==e.responseText?document.getElementById("viewScoutsButton").innerHTML="no results":401===e.status||403===e.status?window.location.href="/login":400===e.status?document.getElementById("viewScoutsButton").innerHTML="bad request":500===e.status?document.getElementById("viewScoutsButton").innerHTML="internal server error":document.getElementById("viewScoutsButton").innerHTML="downloading data..."},e.send()}